import React from "react";
import classes from "./Navbar.module.css";

function Navbar() {
  return (
    <div>
      <nav className={classes.main_nav}>
        <ul className={classes.main_nav__items}>
                  <li className={classes.main_nav__item}>
            <a href="../packages/index.html">Home</a>
          </li>
                  <li className={classes.main - nav__item}>
            <a href="../customers/index.html">Chart</a>
          </li>
                  <li className={ ` ${classes.main - nav__item}  ${classes.main-nav__item__cta } `} >
            <a href="index.html">About</a>
          </li>
                  <li className={`${classes.main - nav__item} ${main - nav__item__cta}`}>
            <a href="index.html">Contact</a>
          </li>
        </ul>
      </nav>
    </div>
  );
}

export default Navbar;
